import React from 'react';

import {
    useMediaQuery
} from "react-responsive";

import Footer from "../../footer/Footer";
import BlockGreetings from "./blocks/BlockGreetings";
import BlockAbout from "./blocks/BlockAbout";
import BlockGame from "./blocks/BlockGame";
import BlockVacancies from "./blocks/vacancies/BlockVacancies";
import BlockArticles from "./blocks/articles/BlockArticles";
import BlockBook from "./blocks/BlockBook";
import Block10Books from "./blocks/books-10/Block10Books";
import BlockRegistration from "./blocks/BlockRegistration";
import BlockSocialNetworks from "./blocks/BlockSocialNetworks";


const LandingMetinvest = () => {
    const isTabletOrMobileDevice
        = useMediaQuery(
        {
            maxDeviceWidth: 1224
        }
    );

    return (
        <div
            className={
                isTabletOrMobileDevice
                    ? "landing-metinvest-frame-mobile"
                    : null
            }>
            <BlockGreetings/>
            <BlockAbout/>
            <BlockGame/>
            <BlockVacancies/>
            <BlockArticles/>
            <BlockBook/>
            <Block10Books/>
            <BlockRegistration/>
            <BlockSocialNetworks/>
            <Footer/>
        </div>
    );
};

export {
    LandingMetinvest as default
};
